import { useMemo, useState } from "react"
import { Form } from "react-bootstrap"
import Select from 'react-select'
import countryList from 'react-select-country-list'
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
const FirstPage = (props) => {
    const options = [
        { value: 'Permanent Resident', label: 'Permanent Resident' },
        { value: 'Citizen', label: 'Citizen' },
        { value: 'Visitor', label: 'Visitor' },
        { value: 'Work Visa', label: 'Work Visa' },
        { value: 'No Legal Status', label: 'No Legal Status' },
        { value: 'Other', label: 'Other' },
        { value: 'Student', label: 'Student' }
    ]
    const [isSelected,setIsSelected] = useState(false);
    const [startDate, setStartDate] = useState(new Date());
    const [value, setValue] = useState('')
    const optionsCountry = useMemo(() => countryList().getData(), [])
    const changeHandler = value => {
        setValue(value)
    }
    const OnchangeSelect = () => 
    {
        setIsSelected(isSelected => !isSelected)
    }
    return (
        <>
            <div className="Current-location">Application context</div>
            <div className="Current-location">Current location</div>
            <div className="Current-location">Give details of the applicant's current location.</div>
            <div className='status'>
                <span className='title-status'>Current location:</span>
                <Select options={optionsCountry} value={value} onChange={changeHandler} className="select" />
            </div>
            <div className='status'>
                <span className='title-status'>Legal status:</span>
                <Select options={options} className="select" />
            </div>

            <div className='Current-location'>
                <span>Will the applicant be accompanied by dependent children at any time during their stay in Australia on this visa?</span>
                <div class="form-check-label" >
                    <div className="check-radio"></div>
                    <Form className="check-radio-answer">
                        {['radio'].map((type) => (
                            <div key={`default-${type}`} className="mb-3">
                                <Form.Check
                                    type={type}
                                    id={`question1-${type}`}
                                    label={"Yes"}
                                     checked={isSelected}
                                    // checked = {OnchangeSelect()}
                                    onChange={OnchangeSelect()}
                                />
                                <Form.Check
                                    type={type}
                                    id={`question1-${type}`}
                                    label={"No"}
                                    //checked={OnchangeSelect()}
                                />
                            </div>
                        ))}
                    </Form>
                </div>

                <span>
                    Has the applicant been granted and entered Australia on a Working Holiday visa (subclass 417) before?
                </span>
                <div class="form-check-label" >
                    <div className="check-radio"></div>
                    <Form className="check-radio-answer">
                        {['radio'].map((type) => (
                            <div key={`default-${type}`} className="mb-3">
                                <Form.Check
                                    type={type}
                                    id={`question1-${type}`}
                                    label={"Yes"}

                                />
                                <Form.Check
                                    type={type}
                                    id={`question1-${type}`}
                                    label={"No"}
                                />
                            </div>
                        ))}
                    </Form>
                </div>
            </div>

            <div className="Current-location">Application Type</div>
            <div className="Current-location">Select the type of work and holiday visa the applicant is applying for:</div>
            <div class="form-check-label-question2" >
                <div key={`default-question2`} className="mb-3">
                    <Form.Check
                        className="question2"
                        type={'radio'}
                        id={`question2`}
                        label={"First Work and Holiday visa (subclass 462)"}
                    />
                    <Form.Check
                        type={'radio'}
                        className="question2"
                        id={`question2`}
                        label={"Second Work and Holiday visa (subclass 462)"}
                    />
                    <Form.Check
                        type={'radio'}
                        className="question2"
                        id={`question2`}
                        label={"Third Work and Holiday visa (subclass 462)"}
                    />
                </div>

            </div>
            <div className='Current-location'>
                <span>Has the applicant been granted and entered Australia on a first Work and Holiday visa (subclass 462) before?</span>
                <div class="form-check-label" >
                    <div className="check-radio"></div>
                    <Form className="check-radio-answer">
                        {['radio'].map((type) => (
                            <div key={`default-${type}`} className="mb-3">
                                <Form.Check
                                    type={type}
                                    id={`question1-${type}`}
                                    label={"Yes"}

                                />
                                <Form.Check
                                    type={type}
                                    id={`question1-${type}`}
                                    label={"No"}
                                />
                            </div>
                        ))}
                    </Form>
                </div>

                
            </div>
            <div className="Current-location">Proposed arrival date</div>
            <div className="DatePicker">
                <div>Proposed arrival date</div>
                <div className="child-date" ><DatePicker selected={startDate} onChange={(date) => setStartDate(date)} />  </div>         
            </div>
            <div className='Current-location'>Government support</div>
            <div className='Current-location'>
                <span>Does the applicant have a letter of government support to attach to this visa application?</span>
                <div class="form-check-label" >
                    <div className="check-radio"></div>
                    <Form className="check-radio-answer">
                        {['radio'].map((type) => (
                            <div key={`default-${type}`} className="mb-3">
                                <Form.Check
                                    type={type}
                                    id={`question1-${type}`}
                                    label={"Yes"}

                                />
                                <Form.Check
                                    type={type}
                                    id={`question1-${type}`}
                                    label={"No"}
                                />
                            </div>
                        ))}
                    </Form>
                </div>
            </div>
            
        </>

    )
}
export default FirstPage;
